import ExpenseItem from './ExpenseItem'
function Expenses(props)
{ 
    return (<div>        
        <ExpenseItem expTitle={props.expenses[0].expTitle} expAmount = {propsexpenses[0].expAmount} expDate = {expenses[0].expDate}></ExpenseItem>
        <ExpenseItem expTitle={props.expenses[1].expTitle} expAmount = {expenses[1].expAmount} expDate = {expenses[1].expDate}></ExpenseItem>
        <ExpenseItem expTitle={props.expenses[2].expTitle} expAmount = {expenses[2].expAmount} expDate = {expenses[2].expDate}></ExpenseItem>      
      </div>);
}
export default Expenses;
